import PackageJSON from '../../../package.json'

async function GetCountriesFilter(name, waterSupplyFrom, resourcesFrom, populationFrom, waterSupplyTo, resourcesTo, populationTo, setError) {

    const model = {
        name,
        waterSupplyFrom,
        resourcesFrom,
        populationFrom,
        waterSupplyTo,
        resourcesTo,
        populationTo
    }

    const json = JSON.stringify(model);
    const url = PackageJSON.API.BaseURL + PackageJSON.API.GetCountriesFilter;

    try {
        const response = await fetch(url, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: json
        })

        if(response.status === 400 && response.json() && response.json().error)
            setError(response.json().error)
    
        if(!response.ok) 
            return [];
    
        return response.json();
    }
    catch(e) {
        console.log(e);
        return [];
    }
}

export default GetCountriesFilter;
